	module.exports = {"title":"Provisioning Docker on Exoscale","date":"2017-08-21","layout":"post","tags":["Docker","Nginx","Exoscale","Digital Ocean","Deployment","CoreOS"],"brief":"Full Stack Docker Application Part 6 - How to send dockerized application to production environment, on Exoscale, Digital Ocean and AWS.","body":"<p>I usually use Digital Ocean and AWS, and we’ll run through both of those but we’ll start off with <a href=\"exoscale.ch\">https://www.exoscale.ch/</a> as they were kind enough to give me $10 credit and its always a good idea to try alternatives out.</p>\n<hr>\n<h3>TLDR / Repo</h3>\n<p>Repository is here <a href=\"https://github.com/institute1937/marsden\">https://github.com/institute1937/marsden</a></p>\n<hr>\n<h3>Pages</h3>\n<ul>\n<li><a href=\"../2017-08-17---dockerize-i-intro/\">Part One - Intro</a></li>\n<li><a href=\"../2017-08-18---dockerize-ii-dockerfiles/\">Part Two - Dockerfiles</a></li>\n<li><a href=\"../2017-08-21---dockerize-iii-nginx/\">Part Three - Nginx</a></li>\n<li><a href=\"../2017-08-21---dockerize-iv-client-container/\">Part Four - Client App</a></li>\n<li><a href=\"../2017-08-21---dockerize-v-clojure-container/\">Part Five - Server App</a></li>\n<li>Part Six - Provisioning</li>\n<li><a href=\"../2017-08-23---dockerize-vii-connect-existing-machine/\">Part Seven - Connect Existing</a></li>\n<li>Part Eight - Ansible - soon</li>\n</ul>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ <span class=\"hljs-keyword\">cat</span> bin/exo/provision.<span class=\"hljs-keyword\">sh</span>\n</code></pre>\n<pre><code>source config/mars.env\n\ndocker-machine create --driver exoscale \\\n  -<span class=\"ruby\">-exoscale-api-key=$exoscaleApiKey \\\n</span>  -<span class=\"ruby\">-exoscale-api-secret-key=$exoscaleApiSecret \\\n</span>  -<span class=\"ruby\">-exoscale-image coreos-stable-<span class=\"hljs-number\">1298</span> \\\n</span>  -<span class=\"ruby\">-exoscale-instance-profile tiny \\\n</span>  -<span class=\"ruby\">-exoscale-disk-size <span class=\"hljs-number\">10</span> \\\n</span>  -<span class=\"ruby\">-exoscale-ssh-user core \\\n</span>  kemerovo\n</code></pre>\n<p>Most of these commands can be found at either docker’s github repo or the exoscale site. I had to do a bit of trial and error as I wanted the CoreOS image and not the default ubuntu. This will create us a docker host on exoscale, named ‘kemerovo’, because I like the name. We’ll need to source our apikey and secret from a conf file - making sure its added to .gitignore so we don’t publish it. I have a template env file.</p>\n<pre><code>➜  marsden git:(master) ✗ cat config/mars<span class=\"hljs-selector-class\">.env</span><span class=\"hljs-selector-class\">.template</span>\n</code></pre>\n<pre><code><span class=\"hljs-attr\">digital_ocean_machine</span>=\n<span class=\"hljs-attr\">aws_machine</span>=\n<span class=\"hljs-attr\">aws_access_key_id</span>=\n<span class=\"hljs-attr\">aws_secret_access_key</span>=\n<span class=\"hljs-attr\">digitalocean-access-token</span>=\n<span class=\"hljs-attr\">exo_machine</span>=\n<span class=\"hljs-attr\">exoscaleApiKey</span>=\n<span class=\"hljs-attr\">exoscaleApiSecret</span>=\n</code></pre>\n<p>API Credentials</p>\n<p>These can be found at <a href=\"https://portal.exoscale.ch/account/profile/api\">https://portal.exoscale.ch/account/profile/api</a></p>\n<p><img src=\"https://s3.eu-west-2.amazonaws.com/io1937/ghpages/exo.png\" alt=\"exo\"></p>\n<p>Now, hopefully we should be able to see our docker-machine.</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ docker-machine <span class=\"hljs-keyword\">ls</span>\n</code></pre>\n<pre><code>NAME     ACTIVE   DRIVER      STATE   URL   SWARM   DOCKER    ERRORS\nalsace     -        amazonec2      Running   tcp://<span class=\"hljs-number\">34.226</span><span class=\"hljs-meta\">.192</span><span class=\"hljs-meta\">.29</span>:<span class=\"hljs-number\">2376</span>             v17<span class=\"hljs-meta\">.05</span><span class=\"hljs-meta\">.0</span>-ce\nbarnowl    -        digitalocean   Running   tcp://<span class=\"hljs-number\">139.59</span><span class=\"hljs-meta\">.189</span><span class=\"hljs-meta\">.142</span>:<span class=\"hljs-number\">2376</span>            v1<span class=\"hljs-meta\">.12</span><span class=\"hljs-meta\">.6</span>\ncoffee     -        virtualbox     Running   tcp://<span class=\"hljs-number\">192.168</span><span class=\"hljs-meta\">.99</span><span class=\"hljs-meta\">.100</span>:<span class=\"hljs-number\">2376</span>            v17<span class=\"hljs-meta\">.06</span><span class=\"hljs-meta\">.0</span>-ce\nkemerovo   -        exoscale       Running   tcp://<span class=\"hljs-number\">159.100</span><span class=\"hljs-meta\">.252</span><span class=\"hljs-meta\">.246</span>:<span class=\"hljs-number\">2376</span>           v1<span class=\"hljs-meta\">.12</span><span class=\"hljs-meta\">.6</span>\n</code></pre>\n<p>We can see our kemerovo docker machine running here on exoscale, succesfully provisioned. So now we want to be able to push our app to it. We can push to any of our docker machines, locally or in the cloud.</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ <span class=\"hljs-keyword\">cat</span> Makefile\n</code></pre>\n<pre><code>start:\n\tdocker-compose up\n\nbundle:\n\tcd<span class=\"hljs-built_in\"> client </span>&amp;&amp; npm <span class=\"hljs-builtin-name\">run</span> build\n\nbuild:\n\tdocker-compose up --build\n\ndeploy-do:\n\t./bin/digital_ocean/deploy.sh\n\ndeploy-aws:\n\t./bin/aws/deploy.sh\n\ndeploy-exo:\n\t./bin/exo/deploy.sh\n</code></pre>\n<p>In the makefile, i’ve linked deploy scripts for 3 providers. I’ve left provisioning out of the makefile for now, at least until we introduce Ansible. To deploy our containerized app to exoscale, we can just run ‘make deploy-exo’, which will run the deploy script.</p>\n<hr>\n<h3>Deploy Scripts</h3>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ <span class=\"hljs-keyword\">cat</span> bin/exo/deploy.<span class=\"hljs-keyword\">sh</span>\n</code></pre>\n<pre><code><span class=\"hljs-keyword\">source</span> config/mars.<span class=\"hljs-keyword\">env</span>\n<span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> $exo_machine)\ndocker-compose -f docker-compose.prod.yml build &amp;&amp; docker-compose -f docker-compose.prod.yml up -d\n<span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> -u)\n</code></pre>\n<p>This will set our active docker-machine to be kemerovo, for the lifetime of the script only. It will the production versions of the docker-compose script (docker-compose.prod.yml), and it will run it in a detached state (-d), as we want to run it as a background job. Let’s look at the production docker-compose.yml.</p>\n<hr>\n<h3>Compose file</h3>\n<pre><code>➜  <span class=\"hljs-selector-tag\">marsden</span> <span class=\"hljs-selector-tag\">git</span><span class=\"hljs-selector-pseudo\">:(master)</span> ✗ <span class=\"hljs-selector-tag\">cat</span> <span class=\"hljs-selector-tag\">docker-compose</span><span class=\"hljs-selector-class\">.prod</span><span class=\"hljs-selector-class\">.yml</span>\n</code></pre>\n<pre><code>version: <span class=\"hljs-string\">\"2\"</span>\nservices:\n\n    web:\n        build: .<span class=\"hljs-built_in\">/client\n</span>        restart: always\n\n    clojure:\n        build: ./clojure\n        restart: always\n\n    nginx:\n        build: .<span class=\"hljs-built_in\">/proxy\n</span>        restart: always\n        ports:\n            - <span class=\"hljs-string\">\"80:80\"</span>\n        links:\n            - web\n            - clojure\n</code></pre>\n<p>Essentially the same as the dev compose file, with four main differences. Firstly, we’re no longer mounting volumes or attempting to access either the client or server containers directly. Secondly, we’re not specifying a dockerfile, which means the default Dockerfile for each container will be used instead of eg Dockerfile.dev</p>\n<p>Thirdly, the nginx container is going to be listening on port 80, not 3100, so we can access it via url. Fourthly, we have a restart always command. As we’re running these in the background, if we reboot or there is a problem with anything we want the containers to restart automatically.</p>\n<hr>\n<h3>Nginx</h3>\n<p>Lets look at nginx again this time, at the production version of our mars.conf</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ <span class=\"hljs-keyword\">cat</span> proxy/sites-enabled/mars.<span class=\"hljs-keyword\">conf</span>\n</code></pre>\n<pre><code><span class=\"hljs-attribute\">upstream</span> front {\n    <span class=\"hljs-attribute\">server</span> web:<span class=\"hljs-number\">5000</span>;\n}\n\n<span class=\"hljs-attribute\">upstream</span> back {\n    <span class=\"hljs-attribute\">server</span> clojure:<span class=\"hljs-number\">3009</span>;\n}\n\n<span class=\"hljs-section\">server</span> {\n    <span class=\"hljs-attribute\">listen</span> <span class=\"hljs-number\">80</span>;\n    <span class=\"hljs-attribute\">server_name</span> mars.io37.ml mars.io37.cf mars.cuya.ml;\n    <span class=\"hljs-attribute\">location</span> / {\n        <span class=\"hljs-attribute\">proxy_pass</span> http://front;\n    }\n    <span class=\"hljs-attribute\">location</span> /clojure {\n        <span class=\"hljs-attribute\">proxy_pass</span>   http://back;\n    }\n}\n</code></pre>\n<p>Here again we see that nginx is going to be listening on port 80 for traffic for 3 specific urls, <a href=\"http://mars.io37.ml\">mars.io37.ml</a>, <a href=\"http://mars.io137.cf\">mars.io137.cf</a>, and <a href=\"http://mars.cuya.ml\">mars.cuya.ml</a> (the DO, AWS and exoscale instances)</p>\n<p><img src=\"https://s3.eu-west-2.amazonaws.com/io1937/ghpages/dns.png\" alt=\"dns\"></p>\n<p>Free domains are available at <a href=\"http://dot.tk\">http://dot.tk</a>, but they don’t allow wildcard subdomains on the free plan, so here I’ve added in ‘mars’ by name.</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) ✗ <span class=\"hljs-keyword\">cat</span> proxy/default.<span class=\"hljs-keyword\">conf</span>\n</code></pre>\n<pre><code><span class=\"hljs-section\">server</span> {\n    <span class=\"hljs-attribute\">listen</span> <span class=\"hljs-number\">80</span>;\n    <span class=\"hljs-attribute\">root</span> /usr/share/nginx/html;\n    <span class=\"hljs-attribute\">server_name</span> <span class=\"hljs-regexp\">*.io</span>37.ml <span class=\"hljs-regexp\">*.io</span>37.cf <span class=\"hljs-regexp\">*.cuya.ml</span>;\n    <span class=\"hljs-attribute\">location</span> / {\n        <span class=\"hljs-attribute\">index</span> index.html;\n    }\n}\n</code></pre>\n<p>Now when we look at our default.conf we can see that if anyone attempts to reach any subdomains they will get an index.html just saying ‘mars!’. We can add more subdomains pointing to other containers, as we see fit - and put a generic message here.</p>\n<hr>\n<h3>AWS + DO</h3>\n<p>Digital Ocean is much the same, provision script</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) <span class=\"hljs-keyword\">cat</span> bin/digital_ocean/provision.<span class=\"hljs-keyword\">sh</span>\n</code></pre>\n<pre><code>source config/mars.env\n\ndocker-machine create <span class=\"hljs-attribute\">--driver</span>=digitalocean \\\n<span class=\"hljs-attribute\">--digitalocean-access-token</span>=<span class=\"hljs-variable\">$digitalocean</span>-access-token \\\n<span class=\"hljs-attribute\">--digitalocean-image</span>=coreos-stable \\\n<span class=\"hljs-attribute\">--digitalocean-region</span>=lon1 \\\n<span class=\"hljs-attribute\">--digitalocean-size</span>=1GB \\\n<span class=\"hljs-attribute\">--digitalocean-ssh-user</span>=core barnowl\n</code></pre>\n<p>and deploy</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(master) <span class=\"hljs-keyword\">cat</span> bin/digital_ocean/deploy.<span class=\"hljs-keyword\">sh</span>\n</code></pre>\n<pre><code><span class=\"hljs-keyword\">source</span> config/mars.<span class=\"hljs-keyword\">env</span>\n<span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> $digital_ocean_machine)\ndocker-compose -f docker-compose.prod.yml build &amp;&amp; docker-compose -f docker-compose.prod.yml up -d\n<span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> -u)\n</code></pre>\n<hr>\n<h3>Next</h3>\n<p><a href=\"../2017-08-23---dockerize-vii-connect-existing-machine/\">Part Seven - Connect Existing</a></p>\n"}

