	module.exports = {"title":"Framework Comparison","date":"2017-08-22","layout":"post","tags":["Webpack","Babel"],"brief":"Part 1 - Comparing Vanilla JS setup with React, Vue, Hyperapp","body":"<p>The purpose of this series is two fold. The first is to get more of a handle on webpack, and the second is to compare various front end frameworks, alongside vanilla JS. When I first moved over to the front end, we used Angular v1 with Gulp. Things have moved pretty fast since then, and I wanted to be able to compare various frameworks but inside the same project. In my docker series I want, eventually, to be able to compare different server side languages each running in their own container inside the same project - and it struck me that I could actually do pretty much the same for javascript, with webpack acting as a kind of glue.</p>\n<p>And the other thing about that is, those node-modules folders get pretty big! Keeping everything all in the same project isn’t just good for easy comparison, its good for my macbook as well!</p>\n<hr>\n<h3>Project Stucture</h3>\n<p>Lets start with an overview of the project structure</p>\n<pre><code>➜  cooper git:(<span class=\"hljs-literal\">master</span>) tree -L <span class=\"hljs-number\">2</span> .\n</code></pre>\n<pre><code>.\n├── CHANGELOG<span class=\"hljs-selector-class\">.md</span>\n├── README<span class=\"hljs-selector-class\">.md</span>\n├── dist\n├── docs\n├── package-lock<span class=\"hljs-selector-class\">.json</span>\n├── package<span class=\"hljs-selector-class\">.json</span>\n├── src\n│   ├── hyperapp\n│   ├── index<span class=\"hljs-selector-class\">.html</span>\n│   ├── react\n│   ├── vanilla\n│   └── vue\n└── webpack\n    ├── webpack<span class=\"hljs-selector-class\">.hyperapp</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n    ├── webpack<span class=\"hljs-selector-class\">.react</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n    ├── webpack<span class=\"hljs-selector-class\">.vanilla</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n    └── webpack<span class=\"hljs-selector-class\">.vue</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n</code></pre>\n<p>We’re going to have 4 builds of the same project, react, vue, hyperapp - and vanilla JS. Each has its own webpack config and its own src directory, but they will all share the same index.html</p>\n<hr>\n<h3>package.json</h3>\n<pre><code>➜  <span class=\"hljs-selector-tag\">cooper</span> <span class=\"hljs-selector-tag\">git</span><span class=\"hljs-selector-pseudo\">:(master)</span> <span class=\"hljs-selector-tag\">cat</span> <span class=\"hljs-selector-tag\">package</span><span class=\"hljs-selector-class\">.json</span>\n</code></pre>\n<pre><code>{\n  <span class=\"hljs-attr\">\"name\"</span>: <span class=\"hljs-string\">\"cooper\"</span>,\n  <span class=\"hljs-attr\">\"version\"</span>: <span class=\"hljs-string\">\"1.0.0\"</span>,\n  <span class=\"hljs-attr\">\"description\"</span>: <span class=\"hljs-string\">\"compare hyperapp, vue and react - and redux and mobx\"</span>,\n  <span class=\"hljs-attr\">\"main\"</span>: <span class=\"hljs-string\">\"index.js\"</span>,\n  <span class=\"hljs-attr\">\"scripts\"</span>: {\n    <span class=\"hljs-attr\">\"hyperapp\"</span>: <span class=\"hljs-string\">\"NODE_ENV=hyperapp webpack-dev-server --host 0.0.0.0 --config webpack/webpack.hyperapp.config.js --open --env.dev\"</span>,\n    <span class=\"hljs-attr\">\"vanilla\"</span>: <span class=\"hljs-string\">\"webpack-dev-server --host 0.0.0.0 --config webpack/webpack.vanilla.config.js --open --env.dev\"</span>,\n    <span class=\"hljs-attr\">\"vue\"</span>: <span class=\"hljs-string\">\"webpack-dev-server --host 0.0.0.0 --config webpack/webpack.vue.config.js --open --env.dev\"</span>,\n    <span class=\"hljs-attr\">\"react\"</span>: <span class=\"hljs-string\">\"NODE_ENV=react webpack-dev-server --host 0.0.0.0 --config webpack/webpack.react.config.js --open --env.dev\"</span>\n  },\n  <span class=\"hljs-attr\">\"devDependencies\"</span>: {\n    <span class=\"hljs-attr\">\"babel-core\"</span>: <span class=\"hljs-string\">\"^6.25.0\"</span>,\n    <span class=\"hljs-attr\">\"babel-loader\"</span>: <span class=\"hljs-string\">\"^7.1.1\"</span>,\n    <span class=\"hljs-attr\">\"babel-plugin-transform-react-jsx\"</span>: <span class=\"hljs-string\">\"^6.24.1\"</span>,\n    <span class=\"hljs-attr\">\"babel-preset-es2015\"</span>: <span class=\"hljs-string\">\"^6.24.1\"</span>,\n    <span class=\"hljs-attr\">\"css-loader\"</span>: <span class=\"hljs-string\">\"^0.28.4\"</span>,\n    <span class=\"hljs-attr\">\"file-loader\"</span>: <span class=\"hljs-string\">\"^0.11.2\"</span>,\n  },\n  <span class=\"hljs-attr\">\"dependencies\"</span>: {\n    <span class=\"hljs-attr\">\"@hyperapp/router\"</span>: <span class=\"hljs-string\">\"github:hyperapp/router\"</span>,\n    <span class=\"hljs-attr\">\"d3v4\"</span>: <span class=\"hljs-string\">\"^4.2.2\"</span>,\n    <span class=\"hljs-attr\">\"hyperapp\"</span>: <span class=\"hljs-string\">\"^0.9.3\"</span>,\n    <span class=\"hljs-attr\">\"react\"</span>: <span class=\"hljs-string\">\"^15.6.1\"</span>,\n    <span class=\"hljs-attr\">\"react-dom\"</span>: <span class=\"hljs-string\">\"^15.6.1\"</span>,\n    <span class=\"hljs-attr\">\"vue\"</span>: <span class=\"hljs-string\">\"^2.4.2\"</span>,\n    <span class=\"hljs-attr\">\"vue-loader\"</span>: <span class=\"hljs-string\">\"^13.0.2\"</span>,\n    <span class=\"hljs-attr\">\"vue-resource\"</span>: <span class=\"hljs-string\">\"^1.3.4\"</span>,\n    <span class=\"hljs-attr\">\"vue-router\"</span>: <span class=\"hljs-string\">\"^2.7.0\"</span>,\n    <span class=\"hljs-attr\">\"vue-template-compiler\"</span>: <span class=\"hljs-string\">\"^2.4.2\"</span>\n  }\n}\n</code></pre>\n<p>Each of the four builds has its own script - eg ‘npm run vue’, and references their webpack build. I ran into some interesting babel issues trying to run both hyperapp and react, which we’ll look at shortly, but thats why we’ve prefaced those scripts with a NODE_ENV.</p>\n<p>Fairly lean on the dependencies, as at this stage we’re not looking to do very much, so this should be as bare bones as possible.</p>\n<pre><code>➜  <span class=\"hljs-selector-tag\">cooper</span> <span class=\"hljs-selector-tag\">git</span><span class=\"hljs-selector-pseudo\">:(master)</span> <span class=\"hljs-selector-tag\">cat</span> <span class=\"hljs-selector-class\">.babelrc</span>\n</code></pre>\n<pre><code>{\n  <span class=\"hljs-attr\">\"env\"</span>: {\n    <span class=\"hljs-attr\">\"hyperapp\"</span>: {\n       <span class=\"hljs-attr\">\"plugins\"</span>: [\n    [<span class=\"hljs-string\">\"transform-react-jsx\"</span>, { <span class=\"hljs-attr\">\"pragma\"</span>: <span class=\"hljs-string\">\"h\"</span> }]\n  ]\n    },\n     <span class=\"hljs-attr\">\"react\"</span>: {\n       <span class=\"hljs-attr\">\"plugins\"</span>: [\n    [<span class=\"hljs-string\">\"transform-react-jsx\"</span>]\n  ]\n    }\n  },\n  <span class=\"hljs-attr\">\"presets\"</span>: [\n    [<span class=\"hljs-string\">\"es2015\"</span>, {\n      <span class=\"hljs-attr\">\"es2015\"</span>: {\n        <span class=\"hljs-attr\">\"modules\"</span>: <span class=\"hljs-literal\">false</span>\n      }\n    }]\n  ]\n}\n</code></pre>\n<p>I ran into problems quite early on with babel here, with hyperapp and react both seeming to want different babel configurations for ‘transform-react-jsx’ to work. So i’ve set up different envs for each, to tie up with the package.json scripts.</p>\n<hr>\n<h3>Next</h3>\n<p>In part II, we’ll start with the webpack configuration files.</p>\n"}

