	module.exports = {"title":"Connect to an existing Docker Machine","date":"2017-08-23","layout":"post","tags":["Docker"],"brief":"Full Stack Docker Application Part 7 - Moving dev environment to Vagrant by connecting Docker Machine to existing Debian and CoreOS docker hosts running in Vagrant VMs.","body":"<p>We can use docker-machine to create a boot2docker instance, but if we want to replicate our production exoscale, digital ocean and aws machines as closely as possible we’ll want to use CoreOS instead. For this we’ll need Vagrant and VirtualBox installed. We’ll setup a debian box with vagrant and then try and connect to it with docker-machine and bring it under docker-machine control.</p>\n<p>Linking to existing hosts with docker-machine was quite a faff, ultimately I’m not super convinced it was worth it, but none of the solutions I found oneline came anyhere near working - and there’s no simple ‘docker-machine add’ facility.</p>\n<p>Let’s go with Debian first, this is the basic Vagrantfile I originally used to set up my vm.</p>\n<hr>\n<h3>TLDR / Repo</h3>\n<p>Repository is here <a href=\"https://github.com/institute1937/marsden\">https://github.com/institute1937/marsden</a></p>\n<hr>\n<h3>Pages</h3>\n<hr>\n<ul>\n<li><a href=\"../2017-08-17---dockerize-i-intro/\">Part One - Intro</a></li>\n<li><a href=\"../2017-08-18---dockerize-ii-dockerfiles/\">Part Two - Dockerfiles</a></li>\n<li><a href=\"../2017-08-21---dockerize-iii-nginx/\">Part Three - Nginx</a></li>\n<li><a href=\"../2017-08-21---dockerize-iv-client-container/\">Part Four - Client App</a></li>\n<li><a href=\"../2017-08-21---dockerize-v-clojure-container/\">Part Five - Server App</a></li>\n<li><a href=\"../2017-08-21---dockerize-vi-provision-exoscale/\">Part Six - Provisioning</a></li>\n<li>Part Seven - Connect Existing</li>\n<li>Part Eight - Ansible - soon</li>\n</ul>\n<hr>\n<h3>Host</h3>\n<pre><code>➜  york <span class=\"hljs-built_in\">cat</span> Vagrantfile\n</code></pre>\n<pre><code>Vagrant.configure(<span class=\"hljs-string\">\"2\"</span>) <span class=\"hljs-keyword\">do</span> |<span class=\"hljs-built_in\">config</span>|\n  <span class=\"hljs-built_in\">config</span>.vm.box = <span class=\"hljs-string\">\"debian/stretch64\"</span>\n  <span class=\"hljs-built_in\">config</span>.ssh.forward_agent = <span class=\"hljs-literal\">true</span>\n  <span class=\"hljs-built_in\">config</span>.ssh.forward_x11 = <span class=\"hljs-literal\">true</span>\n  <span class=\"hljs-built_in\">config</span>.vm.network <span class=\"hljs-string\">\"private_network\"</span>, ip: <span class=\"hljs-string\">\"192.168.99.150\"</span>\n<span class=\"hljs-keyword\">end</span>\n</code></pre>\n<hr>\n<h3>Guest</h3>\n<p>I’m connecting as the vagrant user, so we’ll need to add the vagrant user to the docker group.</p>\n<pre><code>sudo usermod -<span class=\"hljs-selector-tag\">a</span> -G docker vagrant\n</code></pre>\n<p>I couldn’t get docker to start with systemctl, only with dockerd so I added an extra file in the systemd docker to reflect dockerd.</p>\n<pre><code>☁  ~ cat /etc/systemd/system/docker<span class=\"hljs-selector-class\">.service</span><span class=\"hljs-selector-class\">.d</span>/<span class=\"hljs-number\">10</span>-machine<span class=\"hljs-selector-class\">.conf</span>\n</code></pre>\n<pre><code>[Service]\nExecStart=\nExecStart=<span class=\"hljs-string\">/usr/bin/docker</span> daemon -H tcp:<span class=\"hljs-string\">//0.0.0.0</span><span class=\"hljs-function\">:2376</span> -H unix:<span class=\"hljs-string\">///var/run/docker.sock</span> <span class=\"hljs-params\">--storage-driver</span> aufs <span class=\"hljs-params\">--tlsverify</span> <span class=\"hljs-params\">--tlscacert</span> <span class=\"hljs-string\">/etc/docker/ca.pem</span> <span class=\"hljs-params\">--tlscert</span> <span class=\"hljs-string\">/etc/docker/server.pem</span> <span class=\"hljs-params\">--tlskey</span> <span class=\"hljs-string\">/etc/docker/server-key.pem</span> <span class=\"hljs-params\">--label</span> provider=generic\nEnvironment=\n</code></pre>\n<pre><code>☁  ~  cat /etc/systemd/system/docker<span class=\"hljs-selector-class\">.service</span><span class=\"hljs-selector-class\">.d</span>/<span class=\"hljs-number\">11</span>-machine<span class=\"hljs-selector-class\">.conf</span>\n</code></pre>\n<pre><code>[Service]\nExecStart=\nExecStart=<span class=\"hljs-string\">/usr/bin/dockerd</span> -H fd:<span class=\"hljs-string\">//</span> -H tcp:<span class=\"hljs-string\">//0.0.0.0</span><span class=\"hljs-function\">:2376</span> -H unix:<span class=\"hljs-string\">///var/run/docker.sock</span> <span class=\"hljs-params\">--storage-driver</span> aufs <span class=\"hljs-params\">--tlsverify</span> <span class=\"hljs-params\">--tlscacert</span> <span class=\"hljs-string\">/etc/docker/ca.pem</span> <span class=\"hljs-params\">--tlscert</span> <span class=\"hljs-string\">/etc/docker/server.pem</span> <span class=\"hljs-params\">--tlskey</span> <span class=\"hljs-string\">/etc/docker/server-key.pem</span> <span class=\"hljs-params\">--label</span> provider=generic\n</code></pre>\n<pre><code>☁  ~  sudo systemctl status docker<span class=\"hljs-selector-class\">.service</span>\n</code></pre>\n<pre><code>● docker.service - Docker Application Container Engine\n<span class=\"hljs-symbol\">   Loaded:</span> loaded (<span class=\"hljs-regexp\">/lib/</span>systemd<span class=\"hljs-regexp\">/system/</span>docker.service; enabled; vendor <span class=\"hljs-string\">preset:</span> enabled)\n  Drop-<span class=\"hljs-string\">In:</span> <span class=\"hljs-regexp\">/etc/</span>systemd<span class=\"hljs-regexp\">/system/</span>docker.service.d\n           └─<span class=\"hljs-number\">10</span>-machine.conf, <span class=\"hljs-number\">11</span>-machine.conf\n<span class=\"hljs-symbol\">   Active:</span> active (running) since Wed <span class=\"hljs-number\">2017</span><span class=\"hljs-number\">-08</span><span class=\"hljs-number\">-23</span> <span class=\"hljs-number\">13</span>:<span class=\"hljs-number\">25</span>:<span class=\"hljs-number\">29</span> GMT; <span class=\"hljs-number\">32</span>min ago\n<span class=\"hljs-symbol\">     Docs:</span> <span class=\"hljs-string\">https:</span><span class=\"hljs-comment\">//docs.docker.com</span>\n Main <span class=\"hljs-string\">PID:</span> <span class=\"hljs-number\">451</span> (dockerd)\n<span class=\"hljs-symbol\">    Tasks:</span> <span class=\"hljs-number\">46</span> (<span class=\"hljs-string\">limit:</span> <span class=\"hljs-number\">4915</span>)\n<span class=\"hljs-symbol\">   Memory:</span> <span class=\"hljs-number\">137.0</span>M\n<span class=\"hljs-symbol\">      CPU:</span> <span class=\"hljs-number\">1</span>min <span class=\"hljs-number\">6.553</span>s\n<span class=\"hljs-symbol\">   CGroup:</span> <span class=\"hljs-regexp\">/system.slice/</span>docker.service\n           ├─ <span class=\"hljs-number\">451</span> <span class=\"hljs-regexp\">/usr/</span>bin<span class=\"hljs-regexp\">/dockerd -H fd:/</span><span class=\"hljs-regexp\">/ -H tcp:/</span><span class=\"hljs-regexp\">/0.0.0.0:2376 -H unix:/</span><span class=\"hljs-comment\">//var/run/docker.sock --storage-driver aufs --tlsverify --tlscac</span>\n           ├─ <span class=\"hljs-number\">465</span> docker-containerd -l <span class=\"hljs-string\">unix:</span><span class=\"hljs-comment\">///var/run/docker/libcontainerd/docker-containerd.sock --metrics-interval=0 --start-timeout 2m</span>\n           ├─<span class=\"hljs-number\">3255</span> docker-containerd-shim c190933413e6367631e0042175271c0a9f41ad16d6c5633985c8fd4394965a3a <span class=\"hljs-regexp\">/var/</span>run<span class=\"hljs-regexp\">/docker/</span>libcontainerd/c19\n           └─<span class=\"hljs-number\">3280</span> docker-containerd-shim <span class=\"hljs-number\">84672</span>d056d205e3b152626c0f4cdf97465b014706d034f58978b5127374dbf13 <span class=\"hljs-regexp\">/var/</span>run<span class=\"hljs-regexp\">/docker/</span>libcontainerd/<span class=\"hljs-number\">846</span>\n</code></pre>\n<p>docker now running inside vm - now to connect from docker-machine in our host</p>\n<hr>\n<h3>Back to Host</h3>\n<pre><code>➜  ~ docker-machine create <span class=\"hljs-attribute\">--driver</span>=generic --generic-ip-address 192.168.99.150 <span class=\"hljs-attribute\">--generic-ssh-user</span>=vagrant york\n</code></pre>\n<pre><code>Running pre-create checks<span class=\"hljs-built_in\">..</span>.\nCreating machine<span class=\"hljs-built_in\">..</span>.\n(york) <span class=\"hljs-literal\">No</span> SSH key specified. Assuming an existing key at the<span class=\"hljs-built_in\"> default </span>location.\nWaiting <span class=\"hljs-keyword\">for</span> machine <span class=\"hljs-keyword\">to</span> be running, this may take a few minutes<span class=\"hljs-built_in\">..</span>.\nDetecting operating<span class=\"hljs-built_in\"> system </span>of created instance<span class=\"hljs-built_in\">..</span>.\nWaiting <span class=\"hljs-keyword\">for</span> SSH <span class=\"hljs-keyword\">to</span> be available<span class=\"hljs-built_in\">..</span>.\nDetecting the provisioner<span class=\"hljs-built_in\">..</span>.\nProvisioning with debian<span class=\"hljs-built_in\">..</span>.\nCopying certs <span class=\"hljs-keyword\">to</span> the local machine directory<span class=\"hljs-built_in\">..</span>.\nCopying certs <span class=\"hljs-keyword\">to</span> the remote machine<span class=\"hljs-built_in\">..</span>.\nSetting Docker configuration on the remote daemon<span class=\"hljs-built_in\">..</span>.\nChecking<span class=\"hljs-built_in\"> connection </span><span class=\"hljs-keyword\">to</span> Docker<span class=\"hljs-built_in\">..</span>.\nDocker is up <span class=\"hljs-keyword\">and</span> running!\n<span class=\"hljs-keyword\">To</span> see how <span class=\"hljs-keyword\">to</span> connect your Docker<span class=\"hljs-built_in\"> Client </span><span class=\"hljs-keyword\">to</span> the Docker Engine running on this virtual machine, run: docker-machine env york\n</code></pre>\n<p>Make sure your hosts public ssh key (~/.ssh/id_rsa.pub) is added to the vms authorized_keys file (/home/vagrant/.ssh/authorized_keys)</p>\n<p>and you should see the debian docker-machine available</p>\n<pre><code>➜  ~ docker-machine <span class=\"hljs-keyword\">env</span> york\n</code></pre>\n<pre><code><span class=\"hljs-builtin-name\">export</span> <span class=\"hljs-attribute\">DOCKER_TLS_VERIFY</span>=<span class=\"hljs-string\">\"1\"</span>\n<span class=\"hljs-builtin-name\">export</span> <span class=\"hljs-attribute\">DOCKER_HOST</span>=<span class=\"hljs-string\">\"tcp://192.168.99.150:2376\"</span>\n<span class=\"hljs-builtin-name\">export</span> <span class=\"hljs-attribute\">DOCKER_CERT_PATH</span>=<span class=\"hljs-string\">\"/Users/garethrobertlee/.docker/machine/machines/york\"</span>\n<span class=\"hljs-builtin-name\">export</span> <span class=\"hljs-attribute\">DOCKER_MACHINE_NAME</span>=<span class=\"hljs-string\">\"york\"</span>\n</code></pre>\n<pre><code>➜  ~ docker-machine <span class=\"hljs-keyword\">ls</span>\n</code></pre>\n<pre><code>NAME       ACTIVE   DRIVER         STATE     URL                          SWARM   DOCKER        ERRORS\nalsace     -        amazonec2      Running   tcp://<span class=\"hljs-number\">34.226</span><span class=\"hljs-meta\">.192</span><span class=\"hljs-meta\">.29</span>:<span class=\"hljs-number\">2376</span>             v17<span class=\"hljs-meta\">.05</span><span class=\"hljs-meta\">.0</span>-ce\ncoffee     -        virtualbox     Saved                                          Unknown\nkemerovo   -        exoscale       Running   tcp://<span class=\"hljs-number\">159.100</span><span class=\"hljs-meta\">.252</span><span class=\"hljs-meta\">.246</span>:<span class=\"hljs-number\">2376</span>           v1<span class=\"hljs-meta\">.12</span><span class=\"hljs-meta\">.6</span>\nmarsden    -        digitalocean   Running   tcp://<span class=\"hljs-number\">139.59</span><span class=\"hljs-meta\">.189</span><span class=\"hljs-meta\">.142</span>:<span class=\"hljs-number\">2376</span>            v1<span class=\"hljs-meta\">.12</span><span class=\"hljs-meta\">.6</span>\nyork       -        generic        Running   tcp://<span class=\"hljs-number\">192.168</span><span class=\"hljs-meta\">.99</span><span class=\"hljs-meta\">.150</span>:<span class=\"hljs-number\">2376</span>            v17<span class=\"hljs-meta\">.06</span><span class=\"hljs-meta\">.0</span>-ce\n</code></pre>\n<p>We can add a deploy script to push our containers to this machine</p>\n<pre><code>➜  marsden gi<span class=\"hljs-variable\">t:</span>(recordcafe) <span class=\"hljs-keyword\">cat</span> bin/york/deploy.<span class=\"hljs-keyword\">sh</span>\n</code></pre>\n<pre><code><span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> york)\ndocker-compose -f docker-compose.prod.yml build &amp;&amp; docker-compose -f docker-compose.prod.yml up -d\n<span class=\"hljs-keyword\">eval</span> $(docker-machine <span class=\"hljs-keyword\">env</span> -u)\n</code></pre>\n<p>For now I’m just pushing the production environment. We can also later move the dev environment to using the vm’s docker. Then we’ll have moved all our docker hosts off OSX and onto remote docker machines, leaving OSX to function purely as a controller.</p>\n<p>I’ve added a new file in sites-enabled, to cater for our local vm, keeping it separate from our production and dev files.</p>\n<pre><code>➜  marsden git:(recordcafe) cat proxy/sites-enabled/mars<span class=\"hljs-selector-class\">.york</span><span class=\"hljs-selector-class\">.conf</span>\n</code></pre>\n<pre><code><span class=\"hljs-section\">server</span> {\n    <span class=\"hljs-attribute\">listen</span> <span class=\"hljs-number\">80</span>;\n    <span class=\"hljs-attribute\">server_name</span> <span class=\"hljs-number\">192.168.99.150</span> mars.york;\n    <span class=\"hljs-attribute\">location</span> / {\n        <span class=\"hljs-attribute\">proxy_pass</span> http://front;\n    }\n    <span class=\"hljs-attribute\">location</span> /clojure {\n        <span class=\"hljs-attribute\">proxy_pass</span>   http://back;\n    }\n} \n</code></pre>\n<p>This will listen on the vms ip address, and also on mars.york - which we can setup in the mac’s host file.</p>\n<pre><code>➜  <span class=\"hljs-keyword\">marsden </span>git:(recordcafe) grep <span class=\"hljs-number\">150</span> /etc/hosts\n<span class=\"hljs-number\">192</span>.<span class=\"hljs-number\">168</span>.<span class=\"hljs-number\">99</span>.<span class=\"hljs-number\">150</span> <span class=\"hljs-keyword\">mars.york\n</span></code></pre>\n<hr>\n<h3>Troubleshooting</h3>\n<p>I did get this error…</p>\n<pre><code>Recreating 6a1cdddb3c96_marsden_nginx_1 <span class=\"hljs-built_in\">..</span>. <span class=\"hljs-builtin-name\">error</span>\n\nERROR: <span class=\"hljs-keyword\">for</span> 6a1cdddb3c96_marsden_nginx_1  Cannot start<span class=\"hljs-built_in\"> service </span>nginx: driver failed programming external connectivity on endpoint marsden_nginx_1 (ea9a2414d915d3d6c6dc880ab56742e5fbb44874a21f5e5e94f9efdc003ba749): <span class=\"hljs-builtin-name\">Error</span> starting userland proxy: listen tcp 0.0.0.0:80: bind:<span class=\"hljs-built_in\"> address </span>already <span class=\"hljs-keyword\">in</span> use\n</code></pre>\n<p>This is because debian’s own nginx was running on port 80.</p>\n<pre><code>☁  ~  ps -ef | grep nginx\nroot     <span class=\"hljs-number\">11460</span>     <span class=\"hljs-number\">1</span>  <span class=\"hljs-number\">0</span> <span class=\"hljs-number\">09</span>:<span class=\"hljs-number\">34</span> ?        <span class=\"hljs-number\">00</span>:<span class=\"hljs-number\">00</span>:<span class=\"hljs-number\">00</span> nginx: master process /usr/sbin/nginx -g daemon <span class=\"hljs-keyword\">on</span>; master_process <span class=\"hljs-keyword\">on</span>;\n</code></pre>\n<p>So that needs to be turned off</p>\n<pre><code>☁  ~  <span class=\"hljs-selector-tag\">sudo</span> /<span class=\"hljs-selector-tag\">etc</span>/<span class=\"hljs-selector-tag\">init</span><span class=\"hljs-selector-class\">.d</span>/<span class=\"hljs-selector-tag\">nginx</span> <span class=\"hljs-selector-tag\">stop</span>\n<span class=\"hljs-selector-attr\">[ ok ]</span> <span class=\"hljs-selector-tag\">Stopping</span> <span class=\"hljs-selector-tag\">nginx</span> (via systemctl): <span class=\"hljs-selector-tag\">nginx</span><span class=\"hljs-selector-class\">.service</span>.\n</code></pre>\n<p>And prevented from attempting to start at boot time.</p>\n<pre><code>☁  ~  sudo systemctl disable nginx\nSynchronizing state <span class=\"hljs-keyword\">of</span> nginx.service <span class=\"hljs-keyword\">with</span> SysV service script <span class=\"hljs-keyword\">with</span> /<span class=\"hljs-class\"><span class=\"hljs-keyword\">lib</span>/<span class=\"hljs-title\">systemd</span>/<span class=\"hljs-title\">systemd</span>-<span class=\"hljs-title\">sysv</span>-<span class=\"hljs-title\">install</span>.</span>\n<span class=\"hljs-symbol\">Executing:</span> /<span class=\"hljs-class\"><span class=\"hljs-keyword\">lib</span>/<span class=\"hljs-title\">systemd</span>/<span class=\"hljs-title\">systemd</span>-<span class=\"hljs-title\">sysv</span>-<span class=\"hljs-title\">install</span> <span class=\"hljs-title\">disable</span> <span class=\"hljs-title\">nginx</span></span>\n</code></pre>\n<hr>\n<h3>Next</h3>\n<p>Orchestration with Ansible.</p>\n"}

