	module.exports = {"title":"Framework Comparison","date":"2017-08-23","layout":"post","tags":["Webpack","Javascript"],"brief":"Part 2 Using webpack configuration to build React, Vue, Hyperapp and Vanilla JS within the same application.","body":"<p>Our comparison app is going to have four builds, each with its own webpack confg, so we’ll move the various webpack files into their own directory.</p>\n<pre><code>➜  cooper git:(<span class=\"hljs-literal\">master</span>) tree webpack\n</code></pre>\n<pre><code>webpack\n├── webpack<span class=\"hljs-selector-class\">.hyperapp</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n├── webpack<span class=\"hljs-selector-class\">.react</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n├── webpack<span class=\"hljs-selector-class\">.vanilla</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n└── webpack<span class=\"hljs-selector-class\">.vue</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n\n<span class=\"hljs-number\">0</span> directories, <span class=\"hljs-number\">4</span> files\n</code></pre>\n<hr>\n<h3>HTML</h3>\n<pre><code>➜  cooper gi<span class=\"hljs-variable\">t:</span>(master) <span class=\"hljs-keyword\">cat</span> src/<span class=\"hljs-built_in\">index</span>.html\n</code></pre>\n<pre><code><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">html</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">head</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">title</span>&gt;</span>mini-compare out<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">title</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">head</span>&gt;</span>\n\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">body</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"main\"</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"main\"</span>/&gt;</span>\n     <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"./bundle.js\"</span>&gt;</span><span class=\"undefined\"></span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">body</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">html</span>&gt;</span>\n</code></pre>\n<p>Straightforward index file, webpack will build each version into a bundle.js, referenced here. Let’s start with our vanilla config.</p>\n<p>Initial Webpack Configs</p>\n<pre><code>➜  cooper git:(master) cat webpack/webpack<span class=\"hljs-selector-class\">.vanilla</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n</code></pre>\n<pre><code>module.exports = <span class=\"hljs-keyword\">options</span> =&gt; {\n  <span class=\"hljs-keyword\">return</span> {\n    entry: <span class=\"hljs-string\">'./src/vanilla/index.js'</span>,\n    outpu<span class=\"hljs-variable\">t:</span> {\n      filename: <span class=\"hljs-string\">'bundle.js'</span>,\n    },\n    devtoo<span class=\"hljs-variable\">l:</span> <span class=\"hljs-string\">'source-map'</span>,\n    devServer: {\n       por<span class=\"hljs-variable\">t:</span> <span class=\"hljs-number\">2008</span>,\n        historyApiFallback: {\n          <span class=\"hljs-built_in\">index</span>: <span class=\"hljs-string\">'src/index.html'</span>,\n      },\n    },\n  }\n}\n</code></pre>\n<ul>\n<li>The entry point in this case is going to be the index file of the vanilla directory. This is what will be bundled by webpack.</li>\n<li>Output will be bundles.js, which is what the html will look for.</li>\n<li>devtool ‘source-map’ allows us to see which file and line logs and errors appear, rather than in their position in the bundled js file, easier for troubleshooting</li>\n<li>devServer - We’ll serve this build on port 2008, and have src/index.html as our fallback page. Single Page Applications need a root point, in case the user refreshes or tries to access a page directly, meanin the web server would bypass the index file and attempt to load a page that doesn’t exist.</li>\n</ul>\n<hr>\n<h3>React</h3>\n<pre><code>➜  cooper git:(master) cat webpack/webpack<span class=\"hljs-selector-class\">.react</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n</code></pre>\n<pre><code>module.exports = <span class=\"hljs-keyword\">options</span> =&gt; {\n  <span class=\"hljs-keyword\">return</span> {\n    entry: <span class=\"hljs-string\">'./src/react/index.js'</span>,\n    outpu<span class=\"hljs-variable\">t:</span> {\n      filename: <span class=\"hljs-string\">'bundle.js'</span>,\n    },\n    devtoo<span class=\"hljs-variable\">l:</span> <span class=\"hljs-string\">'source-map'</span>,\n    devServer: {\n      por<span class=\"hljs-variable\">t:</span> <span class=\"hljs-number\">2009</span>,\n       historyApiFallback: {\n        <span class=\"hljs-built_in\">index</span>: <span class=\"hljs-string\">'src/index.html'</span>,\n      },\n    },\n    module: {\n      rule<span class=\"hljs-variable\">s:</span> [{\n        loader: <span class=\"hljs-string\">'babel-loader'</span>,\n      }],\n    },\n  }\n}\n</code></pre>\n<p>Almost identical to the vanilla webpack, other than using a different entrypoint, and serving on a different port (2009). We also need babel-loader, for react presets. We should also look again at the .babelrc</p>\n<pre><code>➜  <span class=\"hljs-selector-tag\">cooper</span> <span class=\"hljs-selector-tag\">git</span><span class=\"hljs-selector-pseudo\">:(master)</span> ✗ <span class=\"hljs-selector-tag\">cat</span> <span class=\"hljs-selector-class\">.babelrc</span>\n</code></pre>\n<pre><code>{\n  <span class=\"hljs-attr\">\"env\"</span>: {\n    <span class=\"hljs-attr\">\"hyperapp\"</span>: {\n       <span class=\"hljs-attr\">\"plugins\"</span>: [\n    [<span class=\"hljs-string\">\"transform-react-jsx\"</span>, { <span class=\"hljs-attr\">\"pragma\"</span>: <span class=\"hljs-string\">\"h\"</span> }]\n  ]\n    },\n     <span class=\"hljs-attr\">\"react\"</span>: {\n       <span class=\"hljs-attr\">\"plugins\"</span>: [\n    [<span class=\"hljs-string\">\"transform-react-jsx\"</span>]\n  ]\n    }\n  },\n  <span class=\"hljs-attr\">\"presets\"</span>: [\n    [<span class=\"hljs-string\">\"es2015\"</span>, {\n      <span class=\"hljs-attr\">\"es2015\"</span>: {\n        <span class=\"hljs-attr\">\"modules\"</span>: <span class=\"hljs-literal\">false</span>\n      }\n    }]\n  ]\n}\n</code></pre>\n<p>We can reference the plugins either in webpack itself, or by using this .babelrc file. I’m undecided which is best, but for this project I want to keep the webpack files as similar as possible for comparisons, and keep babel out of it as much as possible to keep things a bit clearer.</p>\n<pre><code>➜  cooper git:(master) cat webpack/webpack<span class=\"hljs-selector-class\">.hyperapp</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n</code></pre>\n<pre><code>module.exports = <span class=\"hljs-keyword\">options</span> =&gt; {\n  <span class=\"hljs-keyword\">return</span> {\n    entry: <span class=\"hljs-string\">'./src/hyperapp/index.js'</span>,\n    outpu<span class=\"hljs-variable\">t:</span> {\n      filename: <span class=\"hljs-string\">'bundle.js'</span>,\n    },\n    devtoo<span class=\"hljs-variable\">l:</span> <span class=\"hljs-string\">'source-map'</span>,\n    devServer: {\n      por<span class=\"hljs-variable\">t:</span> <span class=\"hljs-number\">2002</span>,\n       historyApiFallback: {\n        <span class=\"hljs-built_in\">index</span>: <span class=\"hljs-string\">'src/index.html'</span>,\n      },\n    },\n    module: {\n      rule<span class=\"hljs-variable\">s:</span> [{\n        loader: <span class=\"hljs-string\">'babel-loader'</span>,\n      }],\n    },\n  }\n}\n</code></pre>\n<p>Hyperapp is actually identical to react here, the only differences being in the .babelrc</p>\n<pre><code>➜  cooper git:(master) cat webpack/webpack<span class=\"hljs-selector-class\">.vue</span><span class=\"hljs-selector-class\">.config</span><span class=\"hljs-selector-class\">.js</span>\n</code></pre>\n<pre><code><span class=\"hljs-keyword\">const</span> path = <span class=\"hljs-built_in\">require</span>(<span class=\"hljs-string\">'path'</span>);\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span> <span class=\"hljs-title\">resolve</span> (<span class=\"hljs-params\">dir</span>) </span>{\n  <span class=\"hljs-keyword\">return</span> path.join(__dirname, <span class=\"hljs-string\">'.'</span>, dir)\n}\n\n<span class=\"hljs-built_in\">module</span>.exports = <span class=\"hljs-function\"><span class=\"hljs-params\">options</span> =&gt;</span> {\n  <span class=\"hljs-keyword\">return</span> {\n    entry: <span class=\"hljs-string\">'./src/vue/index.js'</span>,\n    output: {\n      filename: <span class=\"hljs-string\">'bundle.js'</span>,\n    },\n    resolve: {\n      extensions: [<span class=\"hljs-string\">'.js'</span>, <span class=\"hljs-string\">'.vue'</span>, <span class=\"hljs-string\">'.json'</span>],\n      alias: {\n        <span class=\"hljs-string\">'vue$'</span>: <span class=\"hljs-string\">'vue/dist/vue.esm.js'</span>,\n         <span class=\"hljs-string\">'@'</span>: resolve(<span class=\"hljs-string\">'src'</span>)\n        }\n    },\n    devtool: <span class=\"hljs-string\">'source-map'</span>,\n    devServer: {\n      port: <span class=\"hljs-number\">2003</span>,\n      historyApiFallback: {\n        index: <span class=\"hljs-string\">'src/index.html'</span>,\n      },\n    },\n    <span class=\"hljs-keyword\">module</span>: {\n      rules: [{\n        loader: <span class=\"hljs-string\">'babel-loader'</span>,\n      },{\n        test: <span class=\"hljs-regexp\">/\\.vue$/</span>,\n        loader: <span class=\"hljs-string\">'vue-loader'</span>,\n      }],\n    },\n  }\n}\n</code></pre>\n<p>Vue’s webpack is a little more involved, we have an extra loader statement for .vue files, and we have the resolve alias section, which we’ll look at in more detail when we come to view</p>\n<hr>\n<h3>Next</h3>\n<p>Next up we’ll look at the source files for each version.</p>\n"}

